import React from "react";
import styles from'./Copywrite.module.css'

export default function Copywrite() {
  return <div className={styles.paragraf}>
  
  <p className={styles.copywriteColor}>Учебный проект. Все права защищены. 2024</p>
  <p className={styles.symbol}>'&#169;'</p>


</div>
}
